      id: 1103533085,
      type: null,
      body: 'File deletion use case:\n\n**Status: INQUEUE**\n\n1. If the user deletes the **INQUEUE** stage, the file will be hidden from the front-end and in the database, the **is_deleted_case** and **is_deleted_file** columns will be updated to true, and the **archive** column will also be true. When the archive cron job runs, it will delete file or case data from the database. (If we undo the changes from the database to open the **INQUEUE** stage file, the file will not open because we removed the data from both Redis and Minio.)\n\n**Status: COMPLETE**\n\n1. If the user deletes the **COMPLETE**stage file, only the file will be hidden from the front end. And if we undo the changes, the file will be easily visible and come in a readable format. (In this scenario, we only update the **is_deleted_case**, **is_deleted_file**, and **archive** columns in the database).\n\n**Status: FAILED**\n\n1. If the user deletes the **FAILED**stage file, only the file will be hidden from the front end. And if we undo the changes, the file will be easily visible and come in a readable format. (In this scenario, we only update the **is_deleted_case**, **is_deleted_file**, and **archive** columns in the database).',
